import React from 'react';
import{ Menu } from 'semantic-ui-react';
import {Link} from '../routes';

export default ()=>{
    return (
        <Menu>
            <Link route="/">
                <a className="item">EthereumXGames</a>
            </Link>
            <Menu.Menu position="right">
                <Menu.Item>
                    Lottery
                </Menu.Item>
                <Link route="/">
                <a className="item">Coin Flip</a>
            </Link>
            <Link route="/">
                <a className="item">Market</a>
            </Link>

            </Menu.Menu>
        </Menu>
    )
}
